/* eslint-disable no-unused-vars */
import React, { useState } from "react";
import DropDownSection from "./DropDownSection-ReUsable";
import "../styles/dropdown.css";

// This is dummy data where I am iterating to add each iteration into a DropDownSection component
// each will take data and a function to manage the state for that component
const times = {
  id: "any-time",
  name: "Any Time",
  sections: [
    { name: "Any Time", id: "Any Time" },
    { name: "Last 7 days", id: "Last 7 days" },
    { name: "Last 30 days", id: "Last 30 days" },
    { name: "Last 90 days", id: "Last 90 days" },
    { name: "2021", id: "2021" },
    { name: "2020", id: "2020" },
  ],
};
const locations = {
  id: "location",
  name: "Location",
  sections: [
    { name: "All Locations", id: "All Locations" },
    { name: "U.S", id: "U.S" },
    { name: "Foreign Correspondents", id: "Foreign Correspondents" },
    { name: "Australia", id: "Australia" },
    { name: "Hong Kong", id: "Hong Kong" },
    { name: "Russia", id: "Russia" },
    { name: "South Korea", id: "South Korea" },
    { name: "United Kingdom", id: "United Kingdom" },
  ],
};
const sortings = {
  id: "sort-by",
  name: "Sort by",
  sections: [
    { name: "Sort by", id: "All Sections" },
    { name: "Newest to Oldest", id: "Newest to Oldest" },
    { name: "Oldest to Newest", id: "Oldest to Newest" },
  ],
};

const sections = {
  id: "all-sections",
  name: "All Sections",
  sections: [
    { name: "All Sections", id: "All Sections" },
    { name: "People & Culture", id: "people_and_culture" },
    { name: "Company & Product News", id: "company_and_product_news" },
    { name: "Benefits & Resources", id: "benefits_and_resources" },
    { name: "Safety & security", id: "safety_and_security" },
    { name: "Okta & technology", id: "okta_and_technology" },
  ],
};

const MoreFilters = (props) => {
  // eslint-disable-next-line react/prop-types
  //   const { changeSection } = props;
  // takes props of section from <SearchResults />
  const [timing, setTiming] = useState("Any Time");
  const [section, setSection] = useState("All Sections");
  const [author, setAuthor] = useState("All Authors");
  const [sorting, setSorting] = useState("Newest to Oldest");
  const [resetButtonStatus, setResetButtonStatus] = useState(true);

  // eslint-disable-next-line no-console
  function resetFilters() {
    // This function will reset the state in case user clicks on RESET Button
    setTiming("Any Time");
    setSection("All Sections");
    setAuthor("All Authors");
    setSorting("Newest to Oldest");
    setResetButtonStatus(true);
  }

  const changeSection = (newValue) => {
    setResetButtonStatus(false);
    setSection(newValue);
    console.log(section);
  };

  return (
    <div className="moreFilters">
      {/* This div will take DropDownSection Reusable components, which has select tag */}
      {/* DATA prop will be options array as in the dummy data in the bottom
       and selector which is a function that will update the state here */}
      <div className="DropDownMenu">
        {/* <DropDownSection
          data={times}
          selector={setTiming}
          reset={setResetButtonStatus}
        /> */}
        <DropDownSection
          data={sections}
          changeSection={changeSection}
          // selector={changeSection}
          //   reset={setResetButtonStatus}
        />
        {/* <DropDownSection
          data={locations}
          selector={setAuthor}
          reset={setResetButtonStatus}
        /> */}
        {/* <DropDownSection
          data={sortings}
          selector={setSorting}
          reset={setResetButtonStatus}
        /> */}

        {/* This is a button that will reset state
        and has resetFilters Function that will reset the state to the regular state */}
        <div className="dropdown">
          <button
            className="dropbtn-reset"
            type="button"
            onClick={resetFilters}
            disabled={resetButtonStatus}
            style={
              resetButtonStatus
                ? { border: "none", opacity: "30%" }
                : { border: "#d3d3d3 solid 0.5px" }
            }
          >
            Reset
          </button>
        </div>
      </div>
      {/* End of Div for DropDownMenu */}
    </div>
  );
};

export default MoreFilters;
